import React from 'react';
import { UncontrolledCarousel } from 'reactstrap';

const items = [
  {
    src: 'https://www.voglioviverecosi.com/wp-content/uploads/2020/03/CORONAVIRUS-VVC-1900x1080.jpg',

  },
  {
    src: 'https://www.cara.ngo/wp-content/uploads/2020/03/sars-cov-19-800x480.jpg',

  },
  {
    src: 'https://www.heartfoundation.org.au/images/made/images/uploads/news/HF-COVID-800x500_800_480_85_s_c1.jpg',

  }
];

const Example = () => <UncontrolledCarousel items={items} />;

export default Example;
